CREATE TABLE `ttipousuarios` (
  `id_tipo` int(11) NOT NULL,
  `tipo` varchar(50) NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id_tipo`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `tusuarios` (
  `id` int(11) NOT NULL,
  `username` varchar(50) DEFAULT NULL,
  `name` varchar(50) DEFAULT NULL,
  `lastname` varchar(50) DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `password` varchar(60) DEFAULT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  `created_at` datetime DEFAULT NULL,
  `cuenta` bigint(18) NOT NULL,
  `clabe_ban` int(11) NOT NULL,
  `fecha_nac` date NOT NULL,
  `id_departamento` int(11) NOT NULL,
  `id_tipo` int(11) NOT NULL,
  `id_banco` int(3) unsigned zerofill NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_tusuarios_tbancos` (`id_banco`),
  KEY `fk_tusuarios_tdepartamentos` (`id_departamento`),
  KEY `fk_tusuarios_ttipousuarios` (`id_tipo`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `tusuarios_perfiles` (
  `id_clave` int(11) NOT NULL,
  `id_usuario` int(11) NOT NULL,
  `id_perfil` int(11) NOT NULL,
  PRIMARY KEY (`id_clave`),
  KEY `fk_tusuarios_perfiles_tusuarios` (`id_usuario`),
  KEY `fk_tusuarios_perfiles_tperfiles` (`id_perfil`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `tutores` (
  `id_tutor` int(11) NOT NULL,
  `id_alumno` int(11) NOT NULL,
  `nombre_padre` varchar(180) COLLATE utf8_unicode_ci NOT NULL,
  `labor_padre` varchar(180) COLLATE utf8_unicode_ci NOT NULL,
  `telefono_padre` varchar(180) COLLATE utf8_unicode_ci NOT NULL,
  `nombre_madre` varchar(180) COLLATE utf8_unicode_ci NOT NULL,
  `labor_madre` varchar(180) COLLATE utf8_unicode_ci NOT NULL,
  `telefono_madre` varchar(180) COLLATE utf8_unicode_ci NOT NULL,
  `correo` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `facebook` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id_tutor`),
  KEY `fk_tutores_alumnos` (`id_alumno`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




CREATE TABLE `txml` (
  `id_comprob` int(11) NOT NULL,
  `pdf` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `xml` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `descripcion` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `fecha_up` datetime NOT NULL,
  `id_solicitud` int(11) NOT NULL,
  `folio_fiscal` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `folio_interno` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `fecha_factura` date NOT NULL,
  `proveedor` varchar(200) COLLATE utf8_unicode_ci NOT NULL,
  `concepto` varchar(200) COLLATE utf8_unicode_ci NOT NULL,
  `importe` decimal(10,2) NOT NULL,
  `iva` decimal(10,2) NOT NULL,
  `total` decimal(10,2) NOT NULL,
  PRIMARY KEY (`id_comprob`),
  KEY `fk_txml_tsolviaticos` (`id_solicitud`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


